Meteor.startup(function() {

  Meteor.users.remove({});
  /**
  Accounts.createUser({
    username: "leonz",
    email: "leonz@hawaii.edu",
    password: "&k&75Uk1",
    class: 1
  });

  Factory.define('message', Messages, {
    text: function() {
    	return Fake.sentence();
    },
    user: Meteor.users.findOne()._id,
    timestamp: Date.now()
  });**/

  // Add this if you want to remove all messages before seeding
  Messages.remove({});

});
